import * as React from 'react';

import styles from './projects.module.scss';

const ProjectCard: React.FC<IProps> = ({ ...props }) => {
  return <div className={styles.projectCard}>ProjectCard</div>;
};

interface IProps {
  tags: string[];
  title: string;
  image: string;
  description: string;
}

export { ProjectCard };
